y interesting!</p></t>',NULL,NULL,NULL,NULL,'162.158.129.96',0,1),(171,38,4,'2021-08-19 15:58:47',95,'comment','<t><p>I believe you are right Giovanni, we should try to think about it and discuss on possible ideas</p> \n</t>',NULL,NULL,NULL,NULL,'162.158.129.96',0,1),(172,37,3,'2021-08-19 16:04:07',95,'comment','<t><p>Very interesting and useful, thanks!</p>\n</t>','2021-08-19 16:05:34',95,NULL,NULL,'162.158.89.19',0,1),(173,39,2,'2021-08-19 16:07:40',95,'comment','<t><p>It seems to be very interesting, I haven\'t used it but I would like to have it</p></t>','2021-08-19 16:20:40',95,NULL,NULL,'162.158.89.19',0,1),(174,35,5,'2021-08-19 16:09:06',95,'comment','<t><p>Thanks to everybody for sharing your experiences, I think it is very useful to get new idea for the next semester!</p></t>',NULL,NULL,NULL,NULL,'162.158.89.19',0,1),(175,42,2,'2021-08-19 16:10:19',95,'comment','<t><p>The paper contains a lot of useful info!  but It seems to me the link doesn\'t work ...</p></t>','2021-08-19 16:20:02',95,NULL,NULL,'162.158.89.19',0,1),(176,49,2,'2021-08-19 16:13:20',95,'comment','<t><p>I know people the use it and find it very useful. I haven\'t tried it yet.  (Marie check the link, it seems to me it doesn\'t work)</p></t>',NULL,NULL,NULL,NULL,'162.158.89.19',0,1),(177,49,3,'2021-08-19 16:17:11',980,'comment','<t><p>I am also interesting in it!</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.89.19',0,1),(178,42,3,'2021-08-19 16:18:43',980,'comment','<t><p>Very interesting paper!</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.89.19',0,1),(179,38,5,'2021-08-19 16:24:16',980,'comment','<t><p>I think the attitude Giovanni is speaking about is common between students in Mathematics, but very rare for students in other subjects (like biology, engineering, data science , ...)</p></t>',NULL,NULL,NULL,NULL,'162.158.89.19',0,1),(180,41,5,'2021-08-19 16:25:00',980,'comment','<t><p>Thanks for the videos, very interesting!</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.89.19',0,1),(181,40,6,'2021-08-19 16:32:19',980,'comment','<r><p>An other interesting movie is \"Moebius\" <URL url=\"https://en.wikipedia.org/wiki/Moebius_%281996_film%29\">https://en.wikipedia.org/wiki/Moebius_(1996_film)</URL><br/>\nHere the young Mathematicians solve the mistery thanks to his knowledge in Topology</p></r>',NULL,NULL,NULL,NULL,'162.158.129.68',0,1),(182,23,13,'2021-08-19 16:34:01',980,'comment','<t><p>I look at the paper suggested by Elisabetta, it seems that AlNuSet is a really useful tool!</p></t>',NULL,NULL,NULL,NULL,'162.158.129.68',0,1),(183,46,5,'2021-08-19 16:36:34',980,'comment','<t><p>Thanks Francesca for the reference. I find the papers very interesting for all Lecturers, also for the ones which are not expert in Didactic of Mathematics,maybe especially for them!</p></t>',NULL,NULL,NULL,NULL,'162.158.129.68',0,1),(184,44,2,'2021-08-19 16:38:26',980,'comment','<t><p>Very interesting! I don\'t have so long experience in teaching, but I have the impression that very often anxiety is really a big problem, especially for students of other subjectswhich have some exams in Maths</p></t>',NULL,NULL,NULL,NULL,'162.158.129.68',0,1),(185,44,3,'2021-08-19 16:41:17',95,'comment','<t><p>I agree with you! I think this is true both at the School and at the University level</p> </t>','2021-08-19 16:41:32',95,NULL,NULL,'162.158.129.68',0,1),(186,25,6,'2021-08-19 16:44:40',95,'comment','<t><p>For Commutative Algebra the evergreen is Atiyah -McDonald: \"Introduction to Commutative Algebra\"</p></t>',NULL,NULL,NULL,NULL,'162.158.88.226',0,1),(187,51,1,'2021-08-19 17:00:52',95,'comment','<r><p>Does anyone know this book: <URL url=\"https://www.sciencedirect.com/book/9780126288704/mathematical-problem-solving\">https://www.sciencedirect.com/book/9780126288704/mathematical-problem-solving</URL> ?</p></r>',NULL,NULL,NULL,NULL,'162.158.129.58',0,1),(188,44,4,'2021-08-19 17:03:38',95,'comment','<r><p>I found this book that seems to be interesting: <URL url=\"https://www.sciencedirect.com/book/9780128022184/understanding-emotions-in-mathematical-thinking-and-learning\">https://www.sciencedirect.com/book/9780128022184/understanding-emotions-in-mathematical-thinking-and-learning</URL></p>\n</r>','2021-08-21 13:33:06',95,NULL,NULL,'162.158.129.58',0,1),(189,52,1,'2021-08-19 17:06:11',95,'comment','<r><p>I found this interesting paper: <URL url=\"https://thelearningexchange.ca/classroom-assessment-mathematics-paying-attention-students-mathematical-thinking/\">https://thelearningexchange.ca/classroom-assessment-mathematics-paying-attention-students-mathematical-thinking/</URL>   what do you think about it?</p></r>',NULL,NULL,NULL,NULL,'162.158.129.58',0,1),(190,53,1,'2021-08-19 17:08:57',95,'comment','<r><p>A nice video that can be showed to students: <URL url=\"https://www.youtube.com/watch?v=xHtsuOB-TPw\">https://www.youtube.com/watch?v=xHtsuOB-TPw</URL></p>\n</r>',NULL,NULL,NULL,NULL,'162.158.129.58',0,1),(191,54,1,'2021-08-19 17:11:16',95,'comment','<r><p>An interesting paper I want to share with you:<URL url=\"https://www.researchgate.net/publication/320900219_Representations_of_Modelling_in_Mathematics_Education\">https://www.researchgate.net/publication/320900219_Representations_of_Modelling_in_Mathematics_Education</URL></p></r>',NULL,NULL,NULL,NULL,'162.158.129.58',0,1),(192,23,14,'2021-08-19 19:40:04',989,'comment','<r><p>I  looked for some ideas to face  teaching through inclusive approach and I think UDL approach could be interesting. Here the link<br/>\n <URL url=\"https://udlguidelines.cast.org/\">https://udlguidelines.cast.org/</URL><br/>\nWhat do you think about?</p></r>',NULL,NULL,NULL,NULL,'188.114.102.58',0,1),(193,40,7,'2021-08-19 19:49:19',989,'comment','<t><p>I loved The Parrot\'s Theorem, a French novel written by Denis Guedj ... dissemination math book but very amazing.</p></t>',NULL,NULL,NULL,NULL,'188.114.102.58',0,1),(194,49,4,'2021-08-19 19:57:50',989,'comment','<r><p>not specifically for university students but interesting anyway to though