e videos for our math teaching library?</p></r>',NULL,NULL,NULL,NULL,'141.101.76.40',0,1),(210,52,3,'2021-08-25 17:29:23',988,'comment','<t><p>Very interesting, thank you! I found an interesting reference into the paper:<br/>\nLiljedahl, P. (2016). Building thinking classrooms: Conditions for problem solving. In P. Felmer, W. Van Dooren, &amp; J. Kilpatrick (Eds.). Posing and solving mathematical problems: Advances and new perspectives. (pp. 361-386). New York, NY: Springer.</p>\n\n<p>Liljedahl provided a workshop on thinking classrooms in Naples some years ago, it would be interesting to see whether his proposals are also valuable for higher education. What is the main challenge when shifting to higher education, in your experience?</p></t>',NULL,NULL,NULL,NULL,'162.158.92.52',0,1),(211,54,3,'2021-08-25 17:30:01',988,'comment','<t><p>Thank you!!!!!</p></t>',NULL,NULL,NULL,NULL,'162.158.92.52',0,1),(212,51,3,'2021-08-25 17:36:17',988,'comment','<t><p>Thanks Emanuela, a very relevant reference. I like the  fact tha one chapter is devoted to non-cognitive factors such as beliefs. I think that beliefs should e taken into account also in  higher education</p></t>',NULL,NULL,NULL,NULL,'162.158.89.103',0,1),(213,57,1,'2021-08-30 10:14:43',988,'comment','<r><p><URL url=\"https://link.springer.com/article/10.1007/s10649-021-10034-3\">https://link.springer.com/article/10.1007/s10649-021-10034-3</URL></p>\n\n</r>',NULL,NULL,NULL,NULL,'188.114.103.211',0,1),(214,40,10,'2021-08-30 11:10:29',35,'comment','<r><p>@<EMAIL email=\"denegri@dima.unige.it\">denegri@dima.unige.it</EMAIL>#198 Such an inspirational film. Highly recommended! #mathmovie</p></r>',NULL,NULL,NULL,NULL,'141.101.77.149',0,1),(215,57,2,'2021-08-31 16:47:44',95,'comment','<t><p>Very interesting point of view! Both the Chinese and the Jewes cultures can really give interesting hints ...</p> </t>',NULL,NULL,NULL,NULL,'162.158.88.32',0,1),(216,51,4,'2021-08-31 16:48:25',95,'comment','<t><p>I totally agree with you Fr